<!DOCTYPE html>
<html lang="es">
<head>
  <meta charset="UTF-8">
  <title>Flores Amarillas</title>
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <style>
    body {
      margin: 0;
      padding: 0;
      background: linear-gradient(to top, #002200, #000022);
      font-family: Arial, sans-serif;
      color: white;
      height: 100vh;
      overflow: hidden;
    }

    /* Pantalla inicial */
    #inicio {
      display: flex;
      flex-direction: column;
      justify-content: center;
      align-items: center;
      height: 100vh;
      text-align: center;
      padding: 20px;
    }
    button {
      padding: 15px 30px;
      font-size: 20px;
      border: none;
      border-radius: 10px;
      background: yellow;
      cursor: pointer;
      transition: transform 0.2s;
      font-weight: bold;
    }
    button:hover { transform: scale(1.1); }

    /* Escena */
    #escena {
      display: none;
      position: relative;
      width: 100%;
      height: 100%;
      overflow: hidden;
    }

    /* Suelo */
    .suelo {
      position: absolute;
      bottom: 0;
      left: 0;
      width: 100%;
      height: 80px;
      background: linear-gradient(to top, #004400, transparent);
      z-index: 1;
    }

    /* Contenedor de flores */
    .campo-flores {
      position: absolute;
      bottom: 80px;
      width: 100%;
      display: flex;
      justify-content: space-around;
      align-items: flex-end;
      padding: 0 10px;
      box-sizing: border-box;
    }

    /* Flor */
    .flor {
      position: relative;
      animation: balanceo 3s infinite alternate ease-in-out;
      transform-origin: bottom center;
    }

    .tallo {
      width: 6px;
      height: 120px;
      background: green;
      margin: 0 auto;
      border-radius: 3px;
      position: relative;
    }

    /* Hojas */
    .hoja {
      width: 30px;
      height: 15px;
      background: green;
      border-radius: 20px 0;
      position: absolute;
      top: 50%;
      transform-origin: left center;
    }
    .hoja.izq { left: -25px; transform: rotate(-20deg); }
    .hoja.der { right: -25px; transform: rotate(20deg); }

    /* Centro */
    .centro {
      width: 35px;
      height: 35px;
      background: #6b3e00;
      border-radius: 50%;
      position: absolute;
      top: -20px;
      left: 50%;
      transform: translateX(-50%);
      z-index: 2;
      box-shadow: inset 0 0 8px rgba(0,0,0,0.5);
    }

    /* P√©talos */
    .petalo {
      width: 20px;
      height: 55px;
      background: yellow;
      border-radius: 50% 50% 50% 50%;
      position: absolute;
      top: -40px;
      left: 50%;
      transform-origin: bottom center;
      opacity: 0;
      animation: bloom 1s forwards;
    }

    /* 10 p√©talos */
    .petalo:nth-child(2)  { transform: rotate(0deg) translateY(-35px);  animation-delay: 1s; }
    .petalo:nth-child(3)  { transform: rotate(36deg) translateY(-35px); animation-delay: 1.1s; }
    .petalo:nth-child(4)  { transform: rotate(72deg) translateY(-35px); animation-delay: 1.2s; }
    .petalo:nth-child(5)  { transform: rotate(108deg) translateY(-35px); animation-delay: 1.3s; }
    .petalo:nth-child(6)  { transform: rotate(144deg) translateY(-35px); animation-delay: 1.4s; }
    .petalo:nth-child(7)  { transform: rotate(180deg) translateY(-35px); animation-delay: 1.5s; }
    .petalo:nth-child(8)  { transform: rotate(216deg) translateY(-35px); animation-delay: 1.6s; }
    .petalo:nth-child(9)  { transform: rotate(252deg) translateY(-35px); animation-delay: 1.7s; }
    .petalo:nth-child(10) { transform: rotate(288deg) translateY(-35px); animation-delay: 1.8s; }
    .petalo:nth-child(11) { transform: rotate(324deg) translateY(-35px); animation-delay: 1.9s; }

    /* Carta */
    .carta {
      position: absolute;
      top: 50%;
      left: 50%;
      transform: translate(-50%, -50%) scale(0);
      width: 90%;
      max-width: 350px;
      background: white;
      border-radius: 10px;
      box-shadow: 0 0 20px rgba(255,255,0,0.8);
      text-align: center;
      padding: 20px;
      font-size: 18px;
      color: #222;
      animation: abrirCarta 2s 3s forwards;
      z-index: 5;
    }

    /* Luci√©rnagas */
    .luci {
      position: absolute;
      width: 6px;
      height: 6px;
      background: yellow;
      border-radius: 50%;
      opacity: 0.8;
      animation: brillar 2s infinite alternate;
    }

    /* Animaciones */
    @keyframes bloom { to { opacity: 1; } }
    @keyframes balanceo { from { transform: rotate(-2deg); } to { transform: rotate(2deg); } }
    @keyframes abrirCarta { to { transform: translate(-50%, -50%) scale(1); } }
    @keyframes brillar { from { opacity: 0.3; } to { opacity: 1; } }

    /* Responsive */
    @media (max-width: 600px) {
      .carta { font-size: 16px; padding: 15px; }
      .tallo { height: 100px; }
      .petalo { height: 45px; }
    }
  </style>
</head>

        <div class="petalo"></div><div class="petalo"></div><div class="petalo"></div>

    <div class="carta">

    <div class="luci" style="top:40%; left:60%; animation-duration:4s;"></div>

    function iniciar() {
